import clericLogo from './assets/clericLogo.svg';
import './App.css';
import { useState, useEffect, useId, createRef } from 'react';
import TypeWriterText from './TypewriterText';

function InputPage() {
  const questionId = useId();
  const callLogListId = useId();
  const questionInputRef = createRef();
  const callLogInputRef = createRef();
  const [question, setQuestion] = useState('');
  const [callLogs, setCallLogs] = useState('');

  const handleSubmit = () => {
    if (question && typeof question === 'string' && callLogs && typeof callLogs === 'string') {
      console.log('Success')
    } else {
      console.log('Inputs are not valid/empty.');
    }
  };

  return (
    <div className="Input-Page">
      <header className="Input-Page-Header">
        <img src={clericLogo} className="App-Logo" alt="logo" />
        <h2 className="Assignment">Take Home Assignment</h2>
        <h2 className="Top-Name">Brandon Chin</h2>
      </header>
      <body className="Input-Page-Body">
        <div className="Square-Div">
          <div className="TypeWriter-Container">
            <TypeWriterText text="Welcome!" className="Welcome-Text-Container" />
          </div>
          <div className="Question-Container">
            <label htmlFor={questionId} className="Label-Input">
              Please input your question in string form 
            </label>
            <input id={questionId} className="Question-Input" type="string" placeholder="Enter your question..." />
          </div>

          <div className="Logs-Container">
            <label htmlFor={callLogListId} className="Label-Input">
              Please input your call logs as a list
            </label>
            <textarea id={callLogListId} className="Logs-Input" type="list" placeholder="Enter your call logs..."/>
          </div>

          {question && callLogs && typeof question === 'string' && typeof callLogs === 'list' && (
            <button onClick={handleSubmit}>Submit</button>
          )}
        </div>
      </body>
    </div>
  );
}

